                        "ex. οὐκ ἀ. σκοποῦ οὐδ΄ ἀ. δόξης μυθεῖσθαι Hom. — говорить дело;",
                        "οὐκ ἀ. τοῦ πράγματος εἶναι Dem. — не отклоняться от вопроса",
                        "7) (при указании на средство или образ действия) посредством, путем, по",
